As many have  witnessed, an explosion rocked Beirut exactly one month ago. The story that isn't told is how broken Beirut, and Lebanon as country already was, toeing the edge of complete disarray. I wanted to tell this story. With this piece I attempt to show, in an abbreviated form, how we got here. How we arrived at such a massive demonstration of negligence and corruption. 

The soundtrack I produced is uploaded on my soundcloud (link in my bio). Please continue to support vetted charities and organizations assisting with the rebuild and recovery.";}i:121;a:1:{s:14:"comments_count";i:1;}i:122;a:1:{s:11:"likes_count";i:8;}i:123;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvQi8ZANWm";}i:124;a:1:{s:5:"image";s:238:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118771047_689943885065091_5576361511804750493_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=103&_nc_ohc=24SmSKjL380AX9wUTEq&oh=5bc6f4842dd10b2d8ca3f1dae8ceed4f&oe=5F554032";}i:125;a:1:{s:4:"type";s:5:"video";}i:126;a:1:{s:8:"owner_id";i:17400235;}i:127;a:1:{s:14:"owner_username";s:0:"";}i:128;a:1:{s:14:"owner_fullname";s:0:"";}i:129;a:1:{s:9:"owner_pic";s:0:"";}i:130;a:1:{s:2:"id";s:19:"2391210542990000987";}i:131;a:1:{s:10:"short_code";s:11:"CEvSVHWFoNb";}i:132;a:1:{s:12:"created_time";i:1599274531;}i:133;a:1:{s:7:"caption";s:301:"#louisville #local #highlands #mexicanfood #restaurant #church #restaurants #foodie #placestovisit #food #places #unique #place #foodiesofinstagram #instafood #instafoodie #photooftheday #travelgram #instatravel #lebanese #traveller #travelholic #kentucky #likelikelike #tgif #fridaynight #fridayvibes";}i:134;a:1:{s:14:"comments_count";i:0;}i:135;a:1:{s:11:"likes_count";i:8;}i:136;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvSVHWFoNb";}i:137;a:1:{s:5:"image";s:249:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118766449_709747692953218_7180444348506389149_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=110&_nc_ohc=Rut9LyyEJWEAX_bKRep&oh=8b0fc847a3b5f2c19cff288294410c0c&oe=5F7DED79";}i:138;a:1:{s:4:"type";s:5:"image";}i:139;a:1:{s:8:"owner_id";i:4140616055;}i:140;a:1:{s:14:"owner_username";s:0:"";}i:141;a:1:{s:14:"owner_fullname";s:0:"";}i:142;a:1:{s:9:"owner_pic";s:0:"";}i:143;a:1:{s:2:"id";s:19:"2391204547911410302";}i:144;a:1:{s:10:"short_code";s:11:"CEvQ93_juJ-";}i:145;a:1:{s:12:"created_t